import React from 'react';
import bg13 from '../img/bg13.jpg';
import img7 from '../img/img7.jpg';
import bg7 from '../img/bg7.jpg'
import '../styles/acoes.css';
import testimg from "../img/testimg.jpg";
import { Card } from 'antd';
import 'antd/dist/antd.css';
import { createFromIconfontCN } from '@ant-design/icons';

const IconFont = createFromIconfontCN({
  scriptUrl: '//at.alicdn.com/t/font_8d5l8fzk5b87iudi.js',
});

export default function About() {
 return (
   <div className="fullpage1" style={{ backgroundImage: `url(${bg13})` }}>
     <div id='banner'>
         <h1>Atividades desenvolvidas</h1>
         <p>Acreditamos que a educação e alimentação são a base para que nossos alunos tenham as ferramentas necessarias para seu desenvolvimento intelectual e social.</p>       
     </div>
       
       <div className="fp21">
         <div className="capa"><img src={require('../img/bg7.jpg')} /></div>
         <div className="cp">
           <div className="bg"></div>
           <div className="self"><img src={require('../img/img7.jpg')} /></div>
           <h3>Wander Marques</h3>
           <h4>Instrutor de Informatica</h4>
           <p>Engenheiro de Software, atuo na area da tecnologia da informação no geral a 10 anos.</p>
           <div className="socialm">
             <ul>
               <li><IconFont type="icon-facebook" /></li>
               <li><IconFont type="icon-twitter" /></li>
               <li><IconFont type="icon-i" /></li>
             </ul>
           </div>
         </div>
       </div>
       
   </div>
 );
}
